#
# Classes to serve utility functions for agents
#
class Communicate:
    """
    This class contains generic functions for passing data
    back to the rapd_core for logging in data
    """

    def __init__(self,controller_address):
        self.controller_address = controller_address

    def sendBack2(self,reply):
        """
        Send data back over a socket.

        The address for the controller must be set to self.controller_address
        as a tuple or list ex. ['164.54.212.165',500001]
        """

        self.logger.debug('Communicate::sendBack2 %s' % str(self.controller_address))
        #connect
        s = socket.socket(socket.AF_INET, socket.SOCK_STREAM)
        try:
            s.connect(tuple(self.controller_address))
        except:
            self.logger.exception('Failed to initialize socket to controller %s' % str(self.controller_address))
            return(False)
        #bulk out the command
        message = json.dumps(reply)
        message = '<rapd_start>' + message + '<rapd_end>'

        try:
            #now send
            total_sent = 0
            while (total_sent < len(message)):
                sent = s.send(message)
                total_sent += sent
            #close the socket connection
            s.close()
            #return
            return(True)
        except:
            self.logger.exception('Error in sending data to controller')
            return(False)

    def sendBack3(self,reply):
        """
        Send data back over a socket.

        The address for the controller must be set to self.controller_address
        as a tuple or list ex. ['164.54.212.165',500001]
        """

        #connect
        s = socket.socket(socket.AF_INET, socket.SOCK_STREAM)
        try:
            s.connect(tuple(self.controller_address))
        except:
            return(False)
        #bulk out the command
        message = json.dumps(reply)
        message = '<rapd_start>' + message + '<rapd_end>'

        try:
            #now send
            total_sent = 0
            while (total_sent < len(message)):
                sent = s.send(message)
                total_sent += sent
            #close the socket connection
            s.close()
            #return
            return(True)
        except:
            return(False)

